import React from "react";

const Person = () => {
  const data = [
    { name: "Milos", job: "developer", gender: "male" },
    { name: "Milos", job: "developer", gender: "male" },
    { name: "Milos", job: "developer", gender: "male" },
  ];
  const listOfPersons = data.map((person) => {
    return (
      <div className="card">
        <h3>{person.name}</h3>
        <h3>{person.job}</h3>
        <h3>{person.gender}</h3>
      </div>
    );
  });
  console.log(listOfPersons);
  return { listOfPersons };
};
export default Person;
